import React from "react";
import logo from "./logo.svg";
import "./App.css";
import NavBar from "./components/navBar";

function App() {
  return (
    <React.Fragment>
      <NavBar />
      <div className="App">
        <h1>Hello World</h1>
      </div>
    </React.Fragment>
  );
}

export default App;
